import { useEffect, useState } from 'react';
import './App.css';
import api from './services/api'

function App() {

  const [user, setUser] = useState([]);

  useEffect(() => {
    api
      .get("usuario")
      .then((response) => response.json())
      .then(dados => {
        setUser(dados)
      })
      .catch((err) => {
        console.error("ops! ocorreu um erro" + err);
      });
  }, []);
  return (
    <div>
      <p>CPF: {user?.cpf} </p>
      <p>E-mail: {user?.email}</p>
    </div>
  );
}

export default App;
